    container: {
        flex: 1,
        padding: 32,
        backgroundColor: '#F0F0F5'
    },

    image: {
        borderWidth: 2,
        borderColor: 'black',
        borderRadius: 120,
        width: 220,
        height: 220,
        marginLeft: 60
    },

    input: {
        height: 60,
        backgroundColor: '#FFF',
        borderRadius: 10,
        marginBottom: 8,
        paddingHorizontal: 24,
        fontSize: 16,
    },

    main: {
        flex: 1,
        justifyContent: 'center'
    },

    subtitle: {
        color: '#322153',
        fontSize: 20,
        marginLeft: 20,
        fontFamily: 'Cooper',
    },

    title1: {
        color: '#322153',
