        color: '#322153',
        fontSize: 16,
        marginBottom: 15,

    },

    title3: {
        color: '#322153',
        fontSize: 16,
        marginBottom: 15,
    },

    view1: {
        marginTop: 35
    },

    view2: {
        marginTop: 35
    },

    view3: {
        marginTop: 35
    },

}

export default styles;
